;; **
;;; #Create New Individual 
;;; **Check list**
;;; - implement a max combined power sm_power >= p_max
;; **

;; @@
;Alex will have a check function built in to this one.

(defn new-poly-term
  [p_max n]
  "create a new polynomial term with maximum power p_max and maximum term length n_max"
  (vec (repeatedly n #(rand-int (+ 1 p_max))))
  )
